const Home = () => {
    const [menu, setMenu] = useState(false)

    const toggleMenu = () => {
        setMenu(!menu)
    }

    return (
        <>
            <div className="container">
                <div className='Routines'>
                    <p>ROUTINES</p>
                    <DownOutlined onClick={toggleMenu} className='routinesButton' />
                    <nav className={`Routines-nav ${menu ? 'isActive' : ''}`}>
                    <ul className="Routines-ul">
                        <li className="Routines-li"><a href="/3 DAYS" className="Routines-a">3 DAYS</a></li>
                        <li className="Routines-li"><a href="/4 DAYS" className="Routines-a">4 DAYS</a></li>
                        <li className="Routines-li"><a href="/5 DAYS" className="Routines-a">5 DAYS</a></li>
                        <li className="Routines-li"><a href="/6 DAYS" className="Routines-a">6 DAYS</a></li>
                    </ul>
                </nav>
                </div>
                
                <a href="/exercises" className='item'>EXERCISES<DownOutlined id="downout" /></a>
                <a href="/supplementation" className='item'>SUPPLEMENTATION<DownOutlined id="downout" /></a>
            </div>

        </>
    )

}

export default Home
